import css from "styled-jsx/css";

const style = css`  
  h2 {
    margin-left: 20px;  
}

.user-bio {
    margin-left: 120px; 
    font-style: italic;
}
`;

const username = ({ user }) => {  
  return (
    <div>
      <h2>{user.name}</h2>
      <p className="user-bio">{user.bio}</p>
      <style jsx>{style}</style>
    </div>
  );
}
